import aiohttp
from aiohttp import web
import asyncio
import base64
import json
import time


async def callback(msg):
    print("callback:", msg)


async def websocket(session, url):
    print("connecting:", url)
    async with session.ws_connect(url) as ws:
        # init data
        init_data = {
            "chunk_size": [5, 10, 5],
            "wav_name": "wss",
            "is_speaking": True,
            "chunk_interval": 10,
            "itn": True,
            "mode": "2pass",
        }
        # end data
        end_data = {
            "chunk_size": [5, 10, 5],
            "wav_name": "wss",
            "is_speaking": False,
            "chunk_interval": 10,
            "mode": "2pass",
        }
        # voice
        voice_data = ""

        print("send data:", init_data)
        await ws.send_json(init_data)

        await ws.send_bytes(base64.b64decode(voice_data))

        while True:
            response = await ws.receive()

            if response.type == aiohttp.WSMsgType.CLOSED:
                print("Connection closed")
                break
            elif response.type == aiohttp.WSMsgType.ERROR:
                print("Error occurred:", response.data)
                break
            else:
                print("Received:", response.data)
                json_data = json.loads(response.data)
                if response.data["is_final"] == True:
                    break
                else:
                    await ws.send_json(end_data)

        print("send end data", end_data)
        await ws.send_json(end_data)
        print("text:", json_data)
        print("close ws")
        await ws.close()
        await session.close()


async def main(app):
    session = aiohttp.ClientSession()
    await websocket(session, "ws://host:port/asr-online-pythonws/stream")


if __name__ == "__main__":
    app = web.Application()
    asyncio.run(main(app))
